import React, { useState } from 'react'

const Listing = (props) => {
    const [value, setValue] = useState(props.data);
    return(
        <>
            <ul>
                {value?.map((data) => {
                    const {id, name, age, location, number  } = data;
                    return <li key={id}>1{name} {age} {location} {number}</li>;
                })}
            </ul>
        </>
    )
}

export default Listing
